import logo from "./logo.svg";
import "./App.css";

Welcome = (props) => <h1>{props.name}</h1>;

function App() {
  return (
    <div className="App">
      <h1>My APP</h1>
      <Welcome name="Wayne" />
    </div>
  );
}

export default App;
